import { useState } from "react";

function Address() {
  const [address, setAddress] = useState('');
  const getAddress = () => {
    setAddress(e.target.value);
  }
    return(
        <div className="form-group">
            <label htmlFor="address">주소</label>
            <input
              type="text"
              id="address"
              name="address"
              value={address}
              onChange={getAddress}
              required
            />
          </div>
    );
}

export default Address;
